import React from "react";
import './CreateNote.css';

    const CreateNote = () => {
        return (<div>
            <h1>Create Note</h1>.
            <form>
                <input name="title" autoComplete="off"></input>
                <textarea name="content" autoComplete="off"></textarea>
                <button>SUBMIT</button>
                
            </form>
        </div>
        )
        }

export default CreateNote;
